import React from 'react';
import { Box, Container, Grid, Typography,  } from '@mui/material'

function MainPage() {
    const tempData = [
    {
        id: 1,
        title: 'title1',
        content: 'data1'
    },
    {
        id: 2,
        title: 'title2',
        content: 'data2'
    },
    {
        id: 3,
        title: 'title3',
        content: 'data3'
    },
    {
        id: 4,
