        content: 'data8'
    },
    {
        id: 9,
        title: 'title9',
        content: 'data9'
    },
    {
        id: 10,
        title: 'title10',
        content: 'data10'
    },
    {
        id: 11,
        title: 'title11',
        content: 'data11'
    },
    {
        id: 12,
        title: 'title12',
        content: 'data12'
    },
    {
        id: 13,
        title: 'title13',
        content: 'data13'
    },
    {
        id: 14,
        title: 'title14',
        content: 'data14'
    },
    {
        id: 15,
        title: 'title15',
        content: 'data15'
    },
    {
        id: 16,
        title: 'title16',
        content: 'data16'
    },
    {
        id: 17,
        title: 'title17',
        content: 'data17'
    },
    {
        id: 18,
        title: 'title18',
        content: 'data18'
    },
    {
        id: 19,
        title: 'title19',
        content: 'data19'
    },
    {
        id: 20,
        title: 'title20',
        content: 'data20'
    }
];

//xs: 모바일, sm: 태블릿, md,lg,xl: 데스크톱
//각 줄은 12 / size의 값으로 표시됨
  return (
    <Grid container rowSpacing={1} maxWidth="md"
        columnSpacing={{ xs: 1, sm: 2, md: 3 }}
        sx={{
               flexWrap: "wrap", 
               alignItems: "center",
        }}>
      {tempData.map((item) =>
        <Grid item key={item.id} xs={6} sm={4} md={3}>
           <Box>
                <Typography> {item.title} </Typography>
           </Box>
        </Grid>
        )}
</Grid>
  );
}

export default MainPage;
